import React, { Fragment } from 'react';

class TodoList extends React.Component {
	constructor(props) {
		this.state = {
			inputValue: '',
			list: []
		}
	}
	render() {
		return (
			<Fragment>
				<div><input /> <button>提交</button></div>
				<ul>
					<li>学英语</li>
					<li>新梦想</li>
				</ul>
			</Fragment>
		);
	}
}

export default TodoList;
